INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, "トゥインクルウィッシュ", "獣人族", "人助け、応援", "ヒヨリ", 2, 100101, 0, 27, "東山奈央", "A", "人助けが大好き！　前向き格闘娘", 155);
