INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (9, 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 8, "リトルリリカル", "ヒューマン", "いたずら、探検", "ミソギ", 5, 100401, 0, 10, "諸星すみれ", "O", "探検好きのイタズラっ子", 128);
