INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (13, 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 11, "悪魔偽王国軍（ディアボロス）", "魔族", "サックス", "アカリ", 7, 100601, 0, 22, "浅倉杏美", "O", "甘え上手なみんなの人気者", 150);
