INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "ヴァイスフリューゲル　ランドソル支部", "エルフ", "鏡で自分を見ること", "ユキ", 15, 100801, 0, 10, "大空直美", "AB", "ボクは誰よりも美しい", 150);
