INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 9, "自警団（カォン）", "獣人族", "空想、ぬいぐるみ集め", "マホ", 10, 101001, 0, 22, "内田真礼", "O", "マホマホ王国のプリンセス", 155);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (15, 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 8, "ラビリンス", "ヒューマン", "お裁縫", "リノ", 3, 101101, 0, 25, "阿澄佳奈", "A", "人懐っこくてマシンガントークな妹系少女", 156);
