INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 42, "test", 1, "牧場（エリザベスパーク）", "獣人族", "あんパン", "リン", 11, 102601, 0, 1, "小岩井ことり", "B", "遊びと睡眠が何より大事なぐうたら娘", 144);
