INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, "メルクリウス財団", "獣人族", "猫とたわむれること", "タマキ（サマー）", 12, 107901, 0, 1, "沼倉愛美", "AB", "弱きを助け強きをくじく猫娘", 158);
