INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (11, 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, "ルーセント学院", "魔族", "ファッション誌鑑賞、コスメ集め", "ミサキ（ハロウィン）", 14, 108301, 0, 3, "久野美咲", "A", "ちょっとおませな恋に恋する女の子", 120);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (17, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, "カルミナ", "ヒューマン", "各種楽器", "チカ（クリスマス）", 4, 108401, 0, 3, "福原綾香", "O", "人々を守るために歌う、唱喚士の少女", 163);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (12, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, "サレンディア救護院", "ヒューマン", "観劇、おままごと", "クルミ（クリスマス）", 9, 108501, 0, 9, "植田佳奈", "B", "泣き虫で臆病な守ってあげたい女の子", 150);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (14, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, "サレンディア救護院", "ヒューマン", "屋内でできる遊び", "アヤネ（クリスマス）", 9, 108601, 0, 10, "芹澤優", "B", "ぷうきちといつも一緒！", 148);
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (16, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, "トゥインクルウィッシュ", "獣人族", "人助け、応援", "ヒヨリ（ニューイヤー）", 2, 108701, 0, 27, "東山奈央", "A", "人助けが大好き！　前向き格闘娘", 155);
