INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (18, 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, "トゥインクルウィッシュ", "魔族", "読書、乗馬、お茶", "レイ（ニューイヤー）", 2, 108901, 0, 12, "早見沙織", "B", "クールで何事にも真っ直ぐな剣士", 163);
